import React from 'react'


class ViewProducts extends React.Component {

    constructor(props) {
        super(props)
    }


    render() {
        return <>
        <img className="image" src={`data:image/jpeg;base64,${this.props.data.image}`} alt="first image"/>
        </>
    }
}

export default ViewProducts;
